import React from 'react';
import '../styles/AllPropertyListings.css';
import Navbar from '../components/Navbar';
import PropertyFilters from '../components/PropertyFilters';  
import Footer from '../components/Footer';
import Property from '../components/Property';

const AllPropertiesPage = () => {
  const properties = [
    {
      id: 1,
      image: 'https://images.unsplash.com/photo-1564013799919-ab600027ffc6',
      price: 'CHF 2,300,000',
      beds: 4,
      baths: 3,
      sqft: 2800,
      status: 'Available',
      address: 'Zermatt, Switzerland',
      daysOnMarket: 5
    },
    {
      id: 2,
      image: 'https://images.unsplash.com/photo-1512917774080-9991f1c4c750',
      price: 'CHF 1,950,000',
      beds: 3,
      baths: 2,
      sqft: 2200,
      status: 'Available',
      address: 'St. Moritz, Switzerland',
      daysOnMarket: 2
    },
    {
      id: 3,
      image: 'https://images.unsplash.com/photo-1493809842364-78817add7ffb',
      price: 'CHF 2,700,000',
      beds: 5,
      baths: 4,
      sqft: 3200,
      status: 'Available',
      address: 'Verbier, Switzerland',
      daysOnMarket: 10
    },
    {
      id: 4,
      image: 'https://images.unsplash.com/photo-1502672260266-1c1ef2d93688',
      price: 'CHF 1,750,000',
      beds: 3,
      baths: 2,
      sqft: 2100,
      status: 'Available',
      address: 'Interlaken, Switzerland',
      daysOnMarket: 8
    },
    {
      id: 5,
      image: 'https://images.unsplash.com/photo-1522708323590-d24dbb6b0267',
      price: 'CHF 3,100,000',
      beds: 6,
      baths: 5,
      sqft: 3900,
      status: 'Available',
      address: 'Gstaad, Switzerland',
      daysOnMarket: 3
    
    }
  ];

  return (
    <div className="listings-layout">
      <Navbar /> 
      <PropertyFilters />
      <main className="listings-section">
        <div className="listings-header">
          <h1 className="listings-title">All Swiss Chalets</h1>
          <p className="listings-subtitle">
            Browse our complete collection of luxury chalets across Switzerland
          </p>
        </div>

        <div className="properties-grid">
          {properties.map((property) => (
            <Property key={property.id} property={property} variant="detailed" />
          ))}
        </div>
      </main>
    </div>
  );
};

export default AllPropertiesPage;
